import './contact.css'
import Twitter from '../../assests/Images/twitter.png';
import Instagram from '../../assests/Images/instagram.png';
import Github from '../../assests/Images/github-mark-white.png';





const Contact = () => {
  return (
    <section id="contactPage">

        <div id="contact">
            <h1 className="contactPageTitle">Contact Me</h1>
            <span className="contactDesc">Wanna have a chat? <br />Then <br />Lets Begin...</span>
            <form className='contactForm'>
                <input type="text" className="name" placeholder='Your Name' />
                <input type="text" className="email" placeholder='Your Email' />
                <textarea name="message" rows="5" placeholder='Mesaage' className='msg'></textarea>
                <button type='submit'  value="send" className="sumbit">Submit</button>

            </form>


        </div>
    </section>
  )
}

export default Contact
